import React, { useState } from "react";
import "./App.css";

import data from "./data/data.json";

function App() {
  const [person, setPerson] = useState<string>("");

  const handleOnClick = (ev: any) => {
    const value = ev.target.value;

    setPerson(value);
    console.log(ev.target.value);
  };

  const filterPerson = data.filter((user) => {
    return user.dni.toLowerCase().includes(person.toLowerCase());
  });

  const renderDoctor = () => {
    const doctorFind = data.find((element) => {
      return element.dni.toLowerCase().includes(person.toLowerCase());
    });

    console.log(doctorFind);
    if (doctorFind) {
      return (
        <li className="listCharacter__list" key={doctorFind.id}>
          <h3>{doctorFind.name}</h3>
        </li>
      );
    } else {
      return <p>Pon DNI</p>;
    }
  };

  // const dniPersons = filterPerson.find((element: any, id: number) => {
  //   return (
  //     <li className="listCharacter__list" key={element.id}>
  //       <h3>{element.name}</h3>
  //     </li>
  //   );
  // });

  console.log(data, "dataaaa");
  console.log(person, "eeeeeee");
  console.log(filterPerson, "filters");
  // console.log(dniPersons, "real");

  return (
    <div className="App">
      <header className="App-header"></header>
      <main>
        <form>
          <input type="text" defaultValue={person} onChange={handleOnClick} />
          <button type="submit">Click</button>
        </form>
        <ul></ul>
      </main>
    </div>
  );
}

export default App;
